import React from 'react'
import Cell from './Cell'

export default function BottomCells({values}) {
    let bottom = values.split(',').map(Number);
  return (
    <div >
        {
            bottom.map((value)=>{
            return <Cell value={value}/>;
            })
        }
    </div>
  )
}
